import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import { Typography} from '@material-ui/core';
import Grid from '@material-ui/core/Grid';
import Skeleton from '@material-ui/lab/Skeleton';
import Content from '../Content/Content.js'


const useStyles = makeStyles(theme => ({
  root: {
    position: 'center'
  },
  theintro: {
    background: 'linear-gradient(45deg, #F8B8B 40%, #AA8EFF 90%)',
    marginTop: theme.spacing(10),
    marginBottom: theme.spacing(10)
  },
  grid1: {
    background: 'linear-gradient(45deg, #B6CF 40%, #AA8EFF 90%)',
    marginLeft: theme.spacing(5),
    boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
  },
  grid2: {
    background: 'linear-gradient(45deg, #B6CF 40%, #AA8EFF 90%)',
    marginLeft: theme.spacing(15),
    boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
  },

  grid3: {
    background: 'linear-gradient(45deg, #BF8B 40%, #AA8EFF 90%)',
    marginLeft: theme.spacing(17),
    boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
  }, 
  typo1: {
    marginTop: theme.spacing(12),
    marginRight: theme.spacing(15)
  }
}));

export default function SimplePaper() {
  const classes = useStyles();

  return (
    <div >
      <div>
        <Grid container spacing={10} className={classes.theintro}>
          
          <Grid item xs={3} className={classes.grid1}>
            <Content/>
          </Grid>

          <Grid item xs={3} className={classes.grid2} >
            <Content/>
          </Grid>
          
          <Grid item xs={3} className={classes.grid3}>
            <Content/>
          </Grid>
        </Grid>
        <Grid container spacing={10} className={classes.theintro}>
          
          <Grid item xs={3} className={classes.grid1}>
            <Content/>
          </Grid>
          <Grid item xs={3} className={classes.grid2} >
            <Content/>
          </Grid>
          <Grid item xs={3} className={classes.grid3}>
            <Content/>
          </Grid>
        </Grid>
      </div>
        <div>
          <Typography classNmae={classes.typo1} >
            <h2>
              I've been learnig to Code since 2015
            </h2>
          </Typography>


        </div>
    </div>
  );
}
